import React from "react";
import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  return (
    <div className="expenses">
      <ExpenseItem
        amount={props.bajs[0].amount}
        date={props.bajs[0].date}
        title={props.bajs[0].title}
      />
      <ExpenseItem
        title={props.bajs[1].title}
        amount={props.bajs[1].amount}
        date={props.bajs[1].date}
      />
      <ExpenseItem
        title={props.bajs[2].title}
        amount={props.bajs[2].amount}
        date={props.bajs[2].date}
      />
      <ExpenseItem
        title={props.bajs[3].title}
        amount={props.bajs[3].amount}
        date={props.bajs[3].date}
      />
    </div>
  );
}

export default Expenses;
